import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
function FrontEnd() {
  return (
    <div>
      <table class="table table-bordered">
        <thead>
          <tr>
            <th>week</th>
            <th>courseName</th>
            <th>status</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>1 - 2</td>
            <td>React fundamenals</td>
            <td>completed</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default FrontEnd;
